    (err, result) => {
      if (err) throw err;
      res.send({ data: "ADD SUCCESS" });
    }
  );
};

const removeByID = (req, res) => {
  let id = req.params.id;
  connection.query(employeeModel.removeByID, [id], (err, result) => {
